import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowUp } from '@fortawesome/free-solid-svg-icons'

export default function Toop() {

        const clicky=()=>{
            window.scroll.y
        }


    return (
        <div>
            <div onClick={clicky} style={{width:'40px',height:'40px',backgroundColor:'#CDBA6D',position:'fixed',top:'520px',right:'14px',borderRadius:'4px',boxShadow:"2px 2px 2px 1px #666666",zIndex:"10",cursor:"pointer"}} >
<FontAwesomeIcon icon={faArrowUp} style={{fontSize:'27px',color:"#666666",margin:"8px 0 23px 10px"}}  />
             </div>
        </div>
    )
}
